import React, { useState, useEffect } from "react";
import "./styles/App.css";

function App() {
  const [weatherData, setWeatherData] = useState([]);
  const [hotelsData, setHotelsData] = useState([]);
  const [placesData, setPlacesData] = useState([]);
  const [showImage, setShowImage] = useState(false);

  const fetchData = async () => {
    try {
      const weatherResponse = await fetch("http://127.0.0.1:5000/weather");
      const hotelsResponse = await fetch("http://127.0.0.1:5000/hotels");
      const placesResponse = await fetch("http://127.0.0.1:5000/places");

      const weather = await weatherResponse.json();
      const hotels = await hotelsResponse.json();
      const places = await placesResponse.json();

      setWeatherData(weather);
      setHotelsData(hotels);
      setPlacesData(places);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const handleShowImage = () => setShowImage(true);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Travel Dashboard</h1>

        {/* Weather Data */}
        <section>
          <h2>Weather Data</h2>
          <table>
            <thead>
              <tr>
                <th>City</th>
                <th>Temperature</th>
                <th>Condition</th>
              </tr>
            </thead>
            <tbody>
              {weatherData.map((item, index) => (
                <tr key={index}>
                  <td>{item.city}</td>
                  <td>{item.temperature}</td>
                  <td>{item.condition}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Hotels Data */}
        <section>
          <h2>Top Hotels</h2>
          <table>
            <thead>
              <tr>
                <th>City</th>
                <th>Hotel Name</th>
                <th>Rating</th>
                <th>Address</th>
              </tr>
            </thead>
            <tbody>
              {hotelsData.map((item, index) => (
                <tr key={index}>
                  <td>{item.city}</td>
                  <td>{item.name}</td>
                  <td>{item.rating}</td>
                  <td>{item.address}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Places to Visit */}
        <section>
          <h2>Top Places to Visit</h2>
          <table>
            <thead>
              <tr>
                <th>City</th>
                <th>Place Name</th>
                <th>Rating</th>
                <th>Address</th>
              </tr>
            </thead>
            <tbody>
              {placesData.map((item, index) => (
                <tr key={index}>
                  <td>{item.city}</td>
                  <td>{item.place_name}</td>
                  <td>{item.rating}</td>
                  <td>{item.address}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Button to Show Image */}
        <button onClick={handleShowImage} className="show-button">
          Show Report Image
        </button>

        {/* Image Display */}
        {showImage && (
          <img
            src={process.env.PUBLIC_URL + "/report.png"}
            alt="Report Visualization"
            style={{ marginTop: "20px", width: "50%" }}
          />
        )}
      </header>
    </div>
  );
}

export default App;
